const OptionsStyle = {
  body: {
    display: "block",
    backgroundColor: "whitesmoke",
    width: "150px",
    height: "100px",
    position: "relative",
    left: "31%",
    bottom: "1000px",
    borderRadius: "-10px 10px 0px 10px",
  },
  ul: {
    listStyle: "none",
    paddingLeft: "10px",
  },
  li: {
    paddingLeft: "0px",
    textAlign: "left",
    paddingTop: 5,
    cursor: "pointer",
  },
};

export default OptionsStyle;
